import "./style.css";

function App() {
  return (
    <>
      <header className="header">
        <div className="logo">
          <img
            src="robot.png"
            height="80"
            width="80"
            alt="Learn With Me Robot"
          />
          <h1>Learn with me</h1>
        </div>

        <button className="btn btn-large btn-open">Share a fact</button>
      </header>

      <CategoryFilter />
    </>
  );
}

function CategoryFilter() {
  return <aside>Category filter</aside>;
}

export default App;
